import axios from "axios";

export function login({ username, password }) {
    const formData = new FormData();
    formData.append("cqupt_id", "1675537");
    formData.append("password", "4$9Y*%TsYvYHG#K4");
    axios({
        method: "post",
        url: "/dev/api/login",
        data: formData,
        headers: {
            "Content-Type": "multipart/form-data",
            traefik: "user",
        },
    });
}
